import React from 'react';
import './StyleOfButtons.css'

const ListOfButtons = ()=>{
    let items: string[] =["Saved message","Look","Notification","Chat folders","Confidentiality","Language",];
    return <div >
    {items.map((item, index) => (
      <button className='ButtonList' key={index}><p>{item}</p></button>
    ))}
    <p>Help</p>
    <button className='ButtonList'>Quastions in Telintik</button>
    <button className='ButtonList'>Ask a Quastions</button>
  </div>
}
export default ListOfButtons;
